import React from "react";


class TemperatureSlider extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <input className="generalSlider" type="range" min="0" max="6000" value="0" />
            </div>
        );
    }
}

class PressureSlider extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <input type="range" min="0" max="6000" value="0" />
            </div>
        );
    }
}

class SliderCollection extends React.Component {
    constructor(props) {
        super(props);
    } 

    render() {
        return (
            <div>
                <TemperatureSlider />
                <PressureSlider />
            </div>
        );
    }
}

export default SliderCollection
